import { Button, Paper, Stack, TextField } from "@mui/material";
import { Header } from "./Header";
import { InputFile } from "./InputFile";
import { makeStyles } from "@mui/styles";

export const SignUp = () => {
  const classes = useStyles();

  return (
    <div>
      <Header />
      <Paper elevation={1} className={classes.form}>
        <h1 className={classes.title}>Registration form</h1>
        <Stack spacing={2} direction="row" className={classes.formContainer}>
          <Stack spacing={2} direction="column">
            <TextField
              className={classes.field}
              label="Firstname"
              variant="outlined"
            />
            <TextField label="Lastname" variant="outlined" />
            <TextField label="Email" variant="outlined" />
            <TextField label="Password" variant="outlined" />
          </Stack>
          <Stack spacing={2} direction="column">
            <TextField label="Address" variant="outlined" />
            <InputFile accept="image/*" />
          </Stack>
        </Stack>
        <Button className={classes.title} type="submit" variant="contained">
          Sumbit
        </Button>
      </Paper>
    </div>
  );
};

const useStyles = makeStyles({
  field: {
    input: {
      background: "red",
    },
  },
  title: {
    display: "flex",
    justifyContent: "center",
  },
  form: {
    width: "600px",
    margin: "auto",
    marginTop: "150px",
    padding: "60px",
  },
  formContainer: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
});
